window.bookSummaryJSON = "<p><b>Two women. One mission. Do whatever is necessary. </b></p> <p>In this final volume of the Smuggler's Tales, Natalya and Zoya wind up on a mission of mercy back into Toe-Hold space to find out why one of Usoko Mining company's smelters has gone dark. They find an expanding cloud of debris, a crippled ship, and a fleet of mining barges that can't leave the system.</p> <p>Written in Nathan Lowell's popular Trader's Tales and Seeker's Tales universe.</p>"; 
